export const select_id = (id) => ({
	type: 'SELECT_ROOM_ID',
	id
});
export const select_genre = (genre) => ({
	type: 'SELECT_GENRE',
	genre
});

export const fetch_rooms = () => ({
	type: 'FETCH_ROOMS',
});
